import React from 'react';
import { Route, Navigate, Routes } from 'react-router-dom';

const ProtectedRoute = ({ component: Component, isAuthenticated, ...rest }) => {
    return (
        <Routes>
        <Route
            {...rest}
            element={
                isAuthenticated ? (
                    <Component />
                ) : (
                    <Navigate to="/login" replace />
                )
            }
        />
        </Routes>
    );
};

export default ProtectedRoute
